Orbis

Technology Documentary hosted by Mike Goral, published by Discovery Channel broadcasted as part of DC Mighty Planes series in 2012 - English narration


Information
------------------------------

Mighty Planes joins the crew of the worlds only flying eye hospital for their most challenging mission to date. Orbis travels tirelessly around the globe, offering patients in developing countries precious sight-saving treatments.

